Merry merry merryyyy Christmas to all of you beautiful humans.
What a year it has been. I’m so beyond thankful for the never ending love and support I feel from you guys on the daily. I would not be able to do what I love for a living without this platform, so this is a Christmas gift for you to thank you for just being here along on the ride. Your love and attention is priceless, it is the biggest and best gift the universe and god has blessed me with, and I’m just so excited to go into another year of creating tasteful content on social media, and art in so many other different ways.
I really do love this shi* 🥲

Everyone worked their lil asses off (or shall i say big) to make this vision come to life and it came out BETTER THAN I COULD’VE EVER IMAGINED!!! LIKE… PINCH ME!!??

🎥 Thank you @agustinseco and @secoproductions for yet another beautifully shot shuffle concept!

👗Thank you @DIOSABYSECO for absolutely SLAYYYYING with the making of these outfits! My mom and sister made and designed these and when I told them I needed 10 fits they didn’t hesitate or even budge, i have angels around me truly😭

💃🏼And last but not least thank you to the amazingly incredible dancers:
