Incase you didn’t know: myself and 25 of my followers met up in Thailand about a month ago on a group trip in paradise. We arrived as strangers to each other, and left as family. 
Core memories were made and this trip still plays on repeat in my head. I especially daydream about our last day spent together day at @yonabeach the worlds first floating beach club💫 
it was special.

TO MY THAILAND FAMILY:
I MISS YOU DEARLY…🥹 (emo recap video in the making)
Thank you for the love, the smiles, the energy, the connection, the unity, the light and the unique touch that each and every one of you brought.
I’m counting down the days until the next one.
Thank you @trovatrip 🤍

